import React, { Component } from "react";
import './Profile.css';
import Navbar from "../Common/Navbar";
import { Container } from "react-bootstrap";
import image from "../user.png"

class Profile extends Component {

  state = {
    userDetails: {},
    projects: []
  }

  fetchData = async cookieValue => {
    await fetch('http://localhost:5000/user?c=' + cookieValue, {
      method: 'GET',
      mode: 'cors'
    }).then(response => response.json())
    .then((response) => {
      this.setState({
        userDetails: response.userDetails,
        projects: response.projects
      })
      console.log(this.state);
    })
  }

  componentDidMount() {
    let cookieValue;
    const cookies  = document.cookie.split(';');
    cookies.forEach(async (cookie) => {
      if(cookie.split('=')[0].trim() === 'sessionCookie') {
        cookieValue = await decodeURIComponent(cookie.split("=")[1].trim());
      }
    })
    console.log(cookieValue);
    this.fetchData(cookieValue);
  }

  render() {
    return (
      <div>
        <Navbar />
        <Container>
          <div className="identity">
            <img className="userImage" src={image} />
            <div className="hello">
              <h1>Name</h1>
              <h4>UserName</h4>
              <a href="" className="ic1"><i class="fab fa-linkedin"></i></a>
              <a href="" className="ic2"><i class="fab fa-github"></i></a>
            </div>
          </div>
        </Container>
      </div>
    );
  }
}
export default Profile;
